import React from 'react';

const ThemeColors = () => {
  const themeColors = [
    {
      id: 104,
      classTitle: 'primary',
      classColor: 'primary',
      classBg: 'bgPrimary',
    },
    {
      id: 104,
      classTitle: 'secondary',
      classColor: 'secondary',
      classBg: 'bgSecondary',
    },
    {
      id: 104,
      classTitle: 'tertiary',
      classColor: 'tertiary',
      classBg: 'bgTertiary',
    },
    {
      id: 104,
      classTitle: 'accent',
      classColor: 'accent',
      classBg: 'bgAccent',
    },
  ];
  return (
    <>
      <div className='containerFluid1 container1-lg'>
        <div className='sectionTitle pb2'>
          <h5 className='fontStyled fsH5 primary'>Theme Colors</h5>
        </div>

        <div className='row pb1 fontStyled primary'>
          <div className='col6 col3-sm classTitle'>
            <h6 className='fsSM'>Classes Names</h6>
          </div>
          <div className='col6 col9-sm classValue'>
            <h6 className='fsSM displayNone displayBlock-sm'>Appearance</h6>
          </div>
        </div>

        {themeColors.map((tc) => (
          <div className='row alignCenter mb1'>
            <div className='col4 col4-xs col3-sm'>
              <p className={`fsSM fwBold ${tc.classColor}`}>
                .{tc.classTitle}:
              </p>
            </div>
            <div className='col4 col4-xs col4-sm textCenter'>
              <div className={`border p1 light ${tc.classBg}`}>
                {tc.classTitle}
              </div>
            </div>
            <div className='col4 col4-xs col4-sm'>
              <div className={`border p1 bgLight  textCenter ${tc.classColor}`}>
                {tc.classTitle}
              </div>
            </div>
          </div>
        ))}
      </div>
    </>
  );
};

export default ThemeColors;
